import styled from "styled-components";

export const Item = styled.div`
  a {
    border: 1px solid #ccc;
    text-decoration: none;
    margin: 10px;
    padding: 10px;
    border-radius: 5px;
    color: #000;

    .itemImage img {
      width: 100%;
      border-radius: 5px;
    }

    .itemName {
      font-weight: bold;
    }
  }
`;
